import os
import requests
from pymdoccbor.mdoc.issuer import MdocCborIssuer

# Get profile picture online
def get_img(image_url: str):
    response = requests.get(image_url)
    if response.status_code == 200:
        return response.content
    else:
        raise Exception(f"Failed to download image: {response.status_code}")

# Define key info
PKEY = {
    'KTY': 'EC2',
    'CURVE': 'P_256',
    'ALG': 'ES256',
    'D': os.urandom(32),
    'KID': b"demo-kid"
}

PID_DATA = {
        "eu.europa.ec.eudiw.pid.1": {
            "document_number": "123456789",
            "portrait": get_img("https://st.fbk.eu/assets/areas/people/UmbertoMorelli.jpg")
        }
    }

mdoci = MdocCborIssuer(
    private_key=PKEY,
    alg = "ES256"
)

mdoc = mdoci.new(
    doctype="eu.europa.ec.eudiw.pid.1",
    data=PID_DATA,
    devicekeyinfo=PKEY,
    validity = {"issuance_date": "2025-01-17", "expiry_date": "2025-12-31" },
    cert_path="cert_key/certificate.pem"
)

#Check with https://cbor.me/ - Bytes
print(mdoci.dumps())

